	(9,32,'Lanzamiento Suzuki Nueva Vitara','lanzamiento-suzuki-nueva-vitara','','','<a id=\"content-title\">Lanzamiento Suzuki Nueva Vitara<br><br></a>','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            Suzuki Camcar ofrece durante el mes de noviembre atractivos planes de financiamiento para estrenar la nueva Suzuki Vitara 2016. <br><br>\n                        </p>','','','','','','','<p>\n                                Suzuki Camcar ofrece durante el mes de noviembre atractivos planes de financiamiento para estrenar la nueva Suzuki Vitara 2016.\n                            </p>\n                            <p>\n                                Suzuki Camcar invita a conocer y estrenar la nueva Suzuki Vitara 2016, una autentica joya automotriz que conjuga lo mejor de la tecnología y diseño, con el respaldo de la prestigiada marca automotriz SUZUKI.\n                            </p>\n                            <p>\n                                La presentación se llevó a cabo el pasado 5 de Noviembre en “Eria Green City”, dónde se dieron cita clientes e invitados especiales, a quienes se les dio la bienvenida con una elegante recepción, amenizada con sonidos de bossa nova, jazz fusión y saxofón en vivo.\n                            </p>\n                            <p>\n                                Carlos O´connor, gerente comercial de Suzuki Camcar, se encargó de dar la bienvenida  a todos los invityados y, más tarde, Circo Dragón ofreció un espectáculo con fuego, junto a la proyección de un video maping, como preámbulo para la develación de la estrella de la noche: Vitara 2016, la nueva integrante de la familia Suzuki.\n                            </p>\n                            <p>\n                                Directivos de Suzuki CAMCAR explicaron que este nuevo modelo es una fusión entre una SUV y un Crossover, resaltando elementos distintivos tales como las líneas aerodinámicas que la hacen más ligera y, sus dimensiones especiales, únicas con respecto a sus competidores. Elementos distintivos que a su vez se traducen en un mayor ahorro de combustible, además de contar con el diseño bi-tono, una aportación estética nueva, a los vehículos del segmento en México.\n                            </p>\n                            <p>\n                                Entre sus ventajas tecnológicas destaca su motor 1.6 litros y 4 cilindros con una potencia de 118 hp, acoplado en una trasmisión manual de 5 cambios , o bien,  a una totalmente nueva transmisión automática de 6 cambios. Por otra parte, cuenta con rínes de 17” de diseños de vanguardistas.\n                            </p>\n                            <p>\n                                En lo que respectivo a la seguridad, está provista con frenos de disco en las cuatro ruedas y hasta siete bolsas de aire, control de tracción y estabilidad, así como un chasis diseñado para ser ligero y con la capacidad de absorber impactos. No por nada fue premiada por Euro NCAP como el auto más seguro.\n                            </p>\n                            <p>\n                                Por lanzamiento Suzuki CAMCAR contará con excelentes planes de financiamiento que se mantendrán solo el mes de noviembre.\n                            </p>\n                            <p>\n                                Suzuki Vitara. “La vida tiene más de un tono”.\n                            </p>\n                            <p>\n                                Saludos.\n                            </p>','Suzuki Camcar','suzuki-camcar','nueva_vitara_600x400.jpg','','','12 de Noviembre de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n                                <div class=\"row\">\n\n                                    <div class=\"col-md-4 col-sm-4 text-center\">\n                                        <h5 style=\"color: #000; text-transform: uppercase;\"><span style=\"color:#7a7a7a;\">SUZUKI GDL</span></h5>\n                                        <img src=\"../img/sitio/agencias/logos/logo_suzuki.png\" alt=\"SUZUKI\" class=\"x-img x-img-none none agn_logo\">\n                                    </div>\n                                    <div class=\"col-md-8 col-sm-8 text-center\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                                        <a href=\"http://suzukigdl.com.mx/\" class=\"button button-transparent bg-youtube resp-button\" target=\"_blank\">\n                                            <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                                        </a>\n                                        <a href=\"http://facebook.com/SuzukiGuadalajaraLopezMateosYAvVallarta\" class=\"button button-transparent bg-facebook resp-button\" target=\"_blank\">\n                                            <i class=\"fa fa-facebook fa-fw fa-lg\"></i> FACEBOOK\n                                        </a>\n                                        <a href=\"http://twitter.com/Suzuki_Gdl\" class=\"button button-transparent bg-twitter resp-button\" target=\"_blank\">\n                                            <i class=\"fa fa-facebook fa-fw fa-lg\"></i> TWITTER\n                                        </a>\n                                    </div>\n                                </div>\n                            </section>','nueva-vitara-2016',1),
	(10,11,'Nueva agencia Sprinter en Guadalajara','nueva-agencia-sprinter-en-gdl','','','<a id=\"content-title\">Nueva agencia Sprinter en Guadalajara<br></a>','<p class=\"post-paragraph\" id=\"container-paragraph\">\n                            Contando con la presencia de altos directivos de Mercedes-Benz y grupo CAMCAR, se celebró en la ciudad de Guadalajara el cóctel inaugural de la primera agencia Sprinter en Jalisco.\n                        </p>','','','','','','','<p>Contando con la presencia de altos directivos de Mercedes-Benz y grupo CAMCAR, se celebró en la ciudad de Guadalajara el cóctel inaugural de la primera agencia Sprinter en Jalisco. Durante el evento se presentaron los modelos de la nueva Classe V de las vans más reconocidas en la industria del transporte. Con esto Mercedes-Benz se reafirma una vez más, como una de las marcas más influyentes del mercado</p>','Mercedes Benz','mercedes-benz','news_mercedes_benz_new_agencie_sprinter_600x400.jpg','','','04 de Diciembre de 2015','<section id=\"content-section-agencies-news-address\" class=\"no-data-adrress\" style=\"padding: 35px 15px 15px;\"><div class=\"row\">\n                                <div class=\"col-md-4 col-sm-4 text-center\" data-id=\"53\">\n                                    <h5 style=\"color: #000; text-transform: uppercase;\"><span style=\"color:#7a7a7a;\">Eurostern Sprinter</span></h5>\n                                            <img src=\"../img/sitio/agencias/logos/logo_eurostern_sprinter.png\" alt=\"Eurostern Sprinter\" class=\"x-img x-img-none none agn_logo\">\n                                </div>\n                                <div class=\"col-md-8 col-sm-8 text-left\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                                        <div class=\"contact-method\">\n                                            <i class=\"icon pe-7s-phone agn_icono\"></i>\n                                                <span class=\"agn_span\">\n                      