	(11,35,'Segunda edición escala Expo Car Show','segunda-edicion-escala-expo-car-show','','','<a  id=\"content-title\">segunda edición de escala expo car show</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">Dentro de un ambiente sano y familiar, con un aproximado de 500 asistentes, se celebró este domingo 13 de diciembre en las instalaciones de SyC Motors y Mitsubishi Centro</p>','','','','','','','<p>\n                                Dentro de un ambiente sano y familiar, con un aproximado de 500 asistentes, se celebró este domingo 13 de diciembre en las instalaciones de SyC Motors y Mitsubishi Centro, la tercera edición de la Expo Escala Car Show. 58 expositores, 5,000 autos de diversas escalas, concurso de autos custom, ademas de una concurrida subasta hicieron posible que este evento fuera de nuevo un gran éxito.\n                            </p>\n                            <p>\n                                Café la selva, El Barezzito, Bepensa, LO/Jack y Riquisimas Aguas Frescas, estuvieron presentes compartiendo un maravilloso domingo con todos nosotros.\n                            </p>','SYC Motors','syc-motors','portada-noticia-800x600.jpg','','','18 de Diciembre de 2015','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\" style=\"padding: 30px 5px 0px;\">\n                <div class=\"col-md-12 col-sm-12 text-center\">\n                    <img src=\"../img/sitio/agencias/logos/logo_syc_motors_centro.png\" alt=\"LOGO SYC MOTORS\" class=\"x-img x-img-none none agn_logo\">\n                </div>\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-left\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-phone agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        <strong>Ventas:</strong> (33) 3770-0400\n                    </span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-map-marker agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        Av. 16 de Septiembre No. 651 Col. Centro, Guadalajara, Jalisco, C.P. 44180\n                    </span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-clock agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        <strong>Ventas:</strong> Lunes a sábado de 9am a 7pm / Domingos de 10am a 6pm. <br>\n                        <strong>Servicio:</strong> Lunes a viernes de 8am a 7pm / Sábados de 8am a 2pm. <br>\n                        <strong>Refacciones:</strong> Lunes a viernes de 9am a 7pm / Sábados de 9am a 2pm.\n                    </span>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-md-12 text-center\" style=\"padding: 20px;\">\n                <a href=\"http://www.syc-motors.com.mx/\" class=\"button button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/SyCMotorsGdl\" class=\"button button-transparent bg-facebook resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-facebook fa-fw fa-lg\"></i> Facebook\n                </a>\n                <a href=\"https://twitter.com/sycmotors\" class=\"button button-transparent bg-twitter resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-twitter fa-fw fa-lg\"></i> Twitter\n                </a>\n            </div>\n        </div>\n    </section>','expo-car-show-2da-evento',0),
	(12,23,'El León vuelve a rugir en Guanajuato','el-leon-vuelve-a-rugir-en-guanajuato','','','<a  id=\"content-title\">el león vuelve a rugir en Guanajuato.</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">El Grupo Automotriz CAMCAR inauguró en la ciudad la agencia Peugeot León, cuyas instalaciones garantizan al cliente la más alta calidad de servicio.</p>','','','','','','','<p>A partir de este mes, la marca Peugeot vuelve a tener presencia en la ciudad de León Guanajuato.</p>\n\n<p>El Grupo Automotriz CAMCAR inauguró en la ciudad la agencia Peugeot León, cuyas instalaciones garantizan al cliente la más alta calidad de servicio.</p>\n\n<p><strong>PEUGEOT LEÓN</strong> se convierte en la distribuidora número 33 de la marca, la cual estará ubicada en Blvd. Cerro Gordo 101k. Valle del Campestre, una de las zonas más exclusivas de la ciudad. El grupo CAMCAR es reconocido por sus 25 años de experiencia en la industria automotriz, compuesto por 7 grandes grupos que lo respaldan.</p>\n\n<p>En la nueva distribuidora de PEUGEOT, el público podrá encontrar un showroom con los más recientes lanzamientos de la marca, así como los modelos ganadores del Master Test: PEUGEOT 208 y PEUGEOT 308. Estos autos han sido galardonados por su excelente desempeño, seguridad y performance, los cuales los convierten en la mejor opción del mercado.</p>\n\n<p><strong>PEUGEOT LEÓN</strong> cuenta con profesionistas calificados y con todo lo necesario para atender con la excelencia que exige la marca en la satisfacción a sus clientes tanto en venta como en el área de postventa.</p>\n\n<p>Con la inauguración de este nuevo distribuidor, PEUGEOT continúa con su plan de expansión de su Red propuesto en 2014, este año consolida su presencia en México con un crecimiento del 20% en ventas en lo que va del 2015.</p>\n\n<p>El Señor Carlos Martín del Campo, presidente del Grupo, acompañado de Raúl Peñafiel y Jame Olivares, director general y director de Calidad y Desarrollo de la red respectivamente, de Peugeot de México, señaló que “la inauguración de esta agencia permitirá sentir a nuestros clientes una experiencia única; que sientan que ingresan a un lugar exclusivo, en el que podrán apreciar nuestros extraordinarios vehículos en un ambiente único de diseño, calidad y tecnología. Quienes se acerquen a nosotros vivirán una experiencia inolvidable, pues contamos con un extraordinario equipo técnico y humano que los atenderán como se merecen”.</p>\n\n<p>En el evento, Raul Peñafiel agradeció a la Familia Martín del Campo y a aquellos inversores que han tenido fe en ella por “su tenacidad y visión para lograr que ahora podamos decir con placer y orgullo que Peugeot México está más fuerte que nunca. Me siento afortunado de mencionar que tenemos el mejor equipo de México, entre ellos Peugeot León. Hoy estamos con uno de los mejores concesionarios de todo el mundo”. Aprovechó su visita para hacer la primera entrega oficial de la agencia.</p>\n','Peugeot León','peugeot-leon','apertura_peugeot_leon_600x400.jpg','','','30 de Diciembre de 2015','<section id=\"content-start-agencies-news-address\" class=\"no-data-adrress about-content\" style=\"padding: 35px 0 0 0;\"><div class=\"container\">\n    <div class=\"row\">\n        <div class=\"col-md-4 col-sm-4 text-center\" data-id=\"23\">\n            <h5 style=\"color: #000; text-transform: uppercase;\"><span style=\"color:#7a7a7a;\">Peugeot León</span></h5>\n                    <img src=\"../img/sitio/agencias/logos/logo_peugeot.png\" alt=\"Peugeot León\" class=\"x-img x-img-none none agn_logo\">\n        </div>\n        <div class=\"col-md-8 col-sm-8 text-left\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-phone agn_icono\"></i>\n                        <span class=\"agn_span\">\n                                <strong>Ventas: </strong>\n                                477-4360904\n                        </span>\n                        <span class=\"agn_span\">\n                        </span>\n                </div>\n\n            <div class=\"contact-method\">\n                <i class=\"icon pe-7s-map-marker agn_icono\"></i>\n                <span class=\"agn_span\">\n                    Av. Cerro Gordo 101-k Colonia Valle del Campestre,  León Gto., C.P. 37150\n                </span>\n            </div>\n            <div class=\"contact-method\">\n                <i class=\"icon pe-7s-clock agn_icono\"></i>\n                <span class=\"agn_span\">\n                    <strong>Ventas:</strong> lunes a viernes de 9 a 21 hrs. Sábado de 9 a 19 hrs. Domingo de 11 a 17 hrs <br>\n                    <strong>Servicio:</strong> Taller: lunes a viernes de 8:30 a 19 hrs. Sábado de 8:30 a 14 hrs. <br>\n                    <strong>Refacciones:</strong> lunes a viernes de 9 a 14 y de 16 a 19 hrs. Sábado de 9 a 13:30 hrs.\n                </span>\n            </div>\n        </div>\n    </div>\n    <div class=\"row\">\n        <div class=\"col-md-12 text-center\" style=\"padding: 20px 20px 0;\">\n                <a href=\"http://www.peugeotleon.com.mx/peugeot-leon/\" class=\"button button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                    <a href=\"https://www.facebook.com/Peugeot-LEON-529840677173455/?fref=ts\" class=\"button button-transparent bg-facebook resp-button\" target=\"_blank\">\n                            <i class=\"fa fa-facebook fa-fw fa-lg\"></i> Facebook\n                    </a>\n        </div>\n    </div>\n</div>\n</section>','apertura-peugeot-leon',1),
	(13,16,'Automovil Panamericano Best Cars','automovil-panamericano-best-cars','','evoque-panamericano-felicitacion-20_3X27_5-A.jpg','<a id=\"content-title\">Automovil Panamericano Best Cars.</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">Range Rover Evoque sorprende por cuarto año consecutivo y recibe el reconocimiento de “Best cars”.</p>','','','','','','','','Jaguar Land Rover Guadalajara y Country','jaguar-land-rover-guadalajara-y-country','automovil-panamericano-600x400.jpg','','','22 de Marzo de 2016','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\">\n                <h5 style=\"color: #000; text-transform: uppercase;\"><span style=\"color:#7a7a7a;\">LAND ROVER GUADALAJARA Y COUNTRY</span></h5>\n                <img src=\"../img/sitio/agencias/logos/logo_jaguar_land_rover.png\" alt=\"LANDOR ROVER\" class=\"x-img x-img-none none agn_logo\">\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-center\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <a href=\"http://landrovergdl.com.mx/\" class=\"button button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/LandroverGDL\" class=\"button button-transparent bg-facebook resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-facebook fa-fw fa-lg\"></i> FACEBOOK\n                </a>\n            </div>\n        </div>\n    </section>','',1),
	(14,35,'3ra Edición Escala Expo Car Show','tercera-edicion-escala-expo-car-show','','','<a  id=\"content-title\">3ra Edición Escala Expo Car Show</a>','<p class=\"post-paragraph\" id=\"container-paragraph\">El pasado 01 de Mayo se llevo a cabo en las instalaciones de SyC Motors y Mitsubishi Centro la III Exposición de Autos a Escala. \n</p>','','','','','','','<p>\nEl pasado 01 de Mayo se llevo a cabo en las instalaciones de SyC Motors y Mitsubishi Centro la III Exposición de Autos a Escala.\n</p>\n<p>\nEn la que se contó con expositores de San Luis Potosí, Aguascalientes, Jalisco, Monterrey y Morelia.\n</p>\n<p>\nLas familias que asistieron disfrutaron además de la pista de carreras con las trocas monster. Además de aprovechar las promociones para adquirir nuestros modelos Chrysler, Dodge, Jeep, Ram y Mitsubishi.\n</p>','SYC Motors','syc-motors','portada-noticia-escala-expo-car-show-3.jpg','','','09 de Mayo de 2016','<section class=\"\" style=\"padding: 35px 15px 15px;\">\n        <div class=\"row\">\n\n            <div class=\"col-md-4 col-sm-4 text-center\" style=\"padding: 30px 5px 0px;\">\n                <div class=\"col-md-12 col-sm-12 text-center\">\n                    <img src=\"../img/sitio/agencias/logos/logo_syc_motors_centro.png\" alt=\"LOGO SYC MOTORS\" class=\"x-img x-img-none none agn_logo\">\n                </div>\n            </div>\n            <div class=\"col-md-8 col-sm-8 text-left\" style=\"font-size: 16px; padding: 20px 5px 0px;\">\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-phone agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        <strong>Ventas:</strong> (33) 3770-0400\n                    </span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-map-marker agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        Av. 16 de Septiembre No. 651 Col. Centro, Guadalajara, Jalisco, C.P. 44180\n                    </span>\n                </div>\n\n                <div class=\"contact-method\">\n                    <i class=\"icon pe-7s-clock agn_icono\"></i>\n                    <span class=\"agn_span\">\n                        <strong>Ventas:</strong> Lunes a sábado de 9am a 7pm / Domingos de 10am a 6pm. <br>\n                        <strong>Servicio:</strong> Lunes a viernes de 8am a 7pm / Sábados de 8am a 2pm. <br>\n                        <strong>Refacciones:</strong> Lunes a viernes de 9am a 7pm / Sábados de 9am a 2pm.\n                    </span>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-md-12 text-center\" style=\"padding: 20px;\">\n                <a href=\"http://www.syc-motors.com.mx/\" class=\"button button-transparent bg-youtube resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-globe fa-fw fa-lg\"></i> SITIO WEB\n                </a>\n                <a href=\"https://www.facebook.com/SyCMotorsGdl\" class=\"button button-transparent bg-facebook resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-facebook fa-fw fa-lg\"></i> Facebook\n                </a>\n                <a href=\"https://twitter.com/sycmotors\" class=\"button button-transparent bg-twitter resp-button\" target=\"_blank\">\n                    <i class=\"fa fa-twitter fa-fw fa-lg\"></i> Twitter\n                </a>\n            </div>\n        </div>\n    </section>','expo-car-show-3er-evento',1),
